import React from 'react';
import "./index.css";


const App = () => {
 

  return (
    <>
      <Header />
      <CreateNote
        additems={addAllitm}
      />

      {
        data.map((crnVal, index) => {
          return <Node
            key={index}
            id={index}
            title={crnVal.title}
            contant={crnVal.contant}
            dltEvevent={dltEvevent}
          />

        })
      }
    </>
  )
}

export default App;
